// Unit test file for database.go
package db

import (
	"maps"
	"slices"
	"testing"
)

func TestInitializeDBWithBlankFile(t *testing.T) {
	// Reset the dbPositions, dbList
	dbPositions = nil
	dbList = nil

	InitializeDBList("../tests/blank.txt")
	wantPositions := []uint64{}
	var wantList = make(map[uint64]NodeDetails)

	if !slices.Equal(dbPositions, wantPositions) {
		t.Errorf("Blank File Test Failed: want %v, got %v", wantPositions, dbPositions)
	}

	if !maps.Equal(dbList, wantList) {
		t.Errorf("Blank File Test Failed: want %v, got %v", wantList, dbList)
	}
}

